Junit 사용하기
Junit은 Java에서의 단위 테스트를 위한 프레임 워크로 Juint의 사용법을 알아보자
목록

설명
시작하기
기본적인 어노테이션

설명
Junit은 단위 테스트를 하기위한 자바 프레임워크인데 이 단위테스트를 좀더 쉽게 만들어 주는 역활이다. 단위 테스트는 자바에서 작은 단위인 메소드를 실행시켜보고 원하는 값이 나오는지를 테스트 하는 것이다. 물론 Junit에서는 실행속도도 원하는 속도 이하로 나왔는지 테스트를 해주니 속도가 중요한 프로그램에서도 충분히 쓸만하다
시작하기

단위테스트를 하기위한 Class를 정한다.
클래스를 오른쪽 클릭하고 New를 누르면 JunitTestCase를 선택할 수 있다
JunitTestCase를 선택하면, 단위 테스트를 위한 클래스를 만드는 창이 나오는데 이때 Next를 누르자.
Next를 누르면 지정한 Class의 메소드와 지정한 Class가 상속받은 클래스의 메소드가 나온다. 이때 단위 테스트를 원하는 메소드를 선택하자
그럼 선택한 메소드가 다음과 같이나온다.
@Test
void testBackgroundImage(){
 fail("Not yet implemented");
}


이제 원하는 테스트를 진행을 해주면 되는데 다음과 같이 수정을 해주면 된다.


@Test
void testBackgroundImage(){
  지정한클래스 temp =new 지정한클래스의생성자;
  assertEquals(원하는 값, 테스트를 할 메소드);
}

Java/2018-04-15-상속.html.body:
상속이란?
자바에서는 말하는 상속은 부모클래스가 자식클래스에게 private접근자가 아닌 모든 것을 물려주는 것으로, 부모클래스의 메소드부터 속성값까지 모든것을 자식클래스에서 따로 선언을 해줄 필요가 없이 전부 사용이 가능하게 해주는 요소이며, 클래스간의 연관성을 높여주며, 클래스의 재사용성을 증가시켜 주는 요소이다.
부모클래스와 자식 클래스
자바에서는 자식클래스에서 부모클래스를 정하는데, 이때 자식 클래스에서 부모 클래스를 정하는 양식은 이러하다
class 자식클래스 extends 부모클래스{
    ...
}

이와 같이 extends명령어를 사용하여 부모클래스를 지정하며, 객체를 생성할때에도 아래와 같이 생성이 가능하다.
부모클래스 test=new 자식클래스();

이와 같이 부모 클래스를 선언하고 거기에 자식 클래스를 생성하는 규칙을 is a 규칙이라고 한다.
그리고 자식 클래스에서 부모 클래스의 요소를 사용하기 위해 사용하는 명령어를 super이라고 하며, 예제는 다음과 같다.
class 부모클래스{
    String testStr;
    부모클래스(String str){
        testStr=str;
    }
    void showTestStr(){
        System.out.println(testStr);
    }
}

부모 클래스에 String객체와 생성자, String 객체의 값을 출력 해주는 간단한 메소드까지 만들었다.
class 자식클래스 extends 부모클래스{
    자식클래스(String str){
        super(str);
    }
}

자식클래스에서 부모클래스의 생성자를 사용하고 싶은 경우 super()를 사용하여야 한다. 그러나 다른 메소드나 속성을 그대로 사용할 경우 따로 표기를 해줄 필요는 없다.
class Main{
    public static void main(String[] args){
        부모클래스 test=new 자식클래스("테스트");
        test.showTestStr();
    }
}

위와 같이 부모클래스를 선언하고 그곳에 자식클래스를 생성하여도 괜찮으며, 나중에 실력이 좋아지면 클래스의 종속성을 줄이기 위하여 자주 사용되는 기법중 하나이다. 그리고 위처럼 자식클래스에서 따로 showTestStr을 선언해 줄 필요 없이 그냥 객체를 선언해준 다음 사용하면 부모클래스에서 선언한대로 사용이 가능하다.
