Java/2018-04-16-오버라이딩과오버로딩.html.body:
오버라이딩과 오버로딩이란?
일단 오버로딩(OverLoading)은 클래스내에 같은 이름의 메소드를 여러개 생성을 하는 것을 의미한다. 물론 메소드는 이름만 같고 각자 인자값이 틀리던가 인자의 개수가 틀리던가 하는 것이다. 그리고 오버라이딩(OverRiding)은 상속에서 나오는 기술인데, 부모클래스에게서 물려받은 메소드를 자신이 원하는데로 변화를 줘서 사용을 하는 기술이다.
OverLoading
예제
void test(int num){
    ...
}
void test(int num,int num2){
    ...
}
void test(double num){
    ...
}
void test(int num,double num2){
    ...
}
void test(double num,int num2){
    ...
}

이와 같이 다양하게 인자를 줌으로서 OverLoading이 가능하다.
OverRiding
예제
class 부모클래스{
    String testStr;
    부모클래스(String str){
        testStr=str;
    }
    void showTestStr(){
        System.out.println(testStr);
    }
}

class 자식클래스 extends 부모클래스{
    자식클래스(String str){
        super(str);
    }
    @Overriding
    void showTestStr(){
        super.showTestStr();
        System.out.println("커스텀 showTestStr()");
    }
}

자식 클래스에서 부모 클래스에 있는 메소드를 그대로 시행을 한뒤에 추가적인 동작을 정하고 싶은 경우 super.메소드명(인자)를 호출한뒤에 동작을 정해주면 되나, 만약 이름만 사용하고 완전 커스텀을 하고 싶으면 아래와 같이 사용하면 된다
class 자식클래스 extends 부모클래스{
    자식클래스(String str){
        super(str);
    }
    @Overriding
    void showTestStr(){
        System.out.println("커스텀 showTestStr()");
    }
}

super와 this
위에서 언급한데로 super명령어는 상속받은 클래스를 지정하는 명령어이다. 그러나 지금 설명할 this명령어는 현재 클래스를 지정하는 명령어로, 메소드에서 메소드 변수의 명과 클래스 변수의 명이 같은경우 this를 앞에 붙여주면 클래스변수로 지정이 되는 효과가 있다. 물론 앞에 super명령어를 붙여주면 부모클래스의 클래스변수를 불러 올수 있다.

Java/2018-05-02-FromJavaAtCallbackFuncti.body:
Callbackfunction란?
Callbackfunction는 function내에서 매개변수를 받을 때 받는 변수중 function인 것들을 Callbackfunction라고 한다. 자바8에서 추가된 기능인 람다식이 가장 큰 예이다. 자바스크립트와 같이 callback function를 지원하는 언어에서는 별다른 추가 없이 매개변수를 function로 주면 끝나나 Java에서는 Interface를 통해 Abstract method를 추가를 해줘야 한다.
JavaScript 에서의 Callback Function
function example(how,are,you){
    .....
    you();
}
example("I","am",function(){
    console.log("seungmun");
});

위와 같이 JavaScript에서는 변수와 function를 저장하는 공간에 차이가 없기 때문에, 표시는 다른 변수와 같이 하고 function내에서 실행을 시켜주면 된다. 그리고 사용은 function를 따로 선언하고 해도 되고 그게 귀찮으면 위에서 처럼 function를 통채로 넘겨 줄 수도 있다.
Java 에서의 Callback Function
public interface CallBackEvent {
    public void callBackEvent(Object obj);
}

위와 같이 interface를 만들어 주고,
public class Test {
    public void testMethod1(){
        System.out.println("who are you");
    }
    public void testMethod2(CallBackEvent event){
        event.callBackEvent(this);
    }
}

CallBackEvent interfac를 매개변수로 가지는 메소드를 지닌 class를 만든다. 그리고 event interface에 있는 Abstract method인 callBackEvent를 호출한다. 이때 this를 넘겨주는데 이런식으로 넘겨주면 객체를 넘겨는형식이 된다. 그래서 그 class에 있는 모든 method를 사용이 가능하다.
public class MainThread {
    public static void main(String[] args) {
        String name="seung mun";
        Test test=new Test();

        test.testMethod2(new CallBackEvent() {
            @Override
            public void callBackEvent(Object obj) {
                ((Test)obj).testMethod1();
                System.out.println("who are you");
            }
        });
    }
}

이 코드에서 알아야  하는 부분이 있는데 우리가 class를 선언하고 사용을 할때 2개의 명령어를 통합해서 대부분 사용하는데 분리를 하면,
Test test=null;

 부분으로 자바의 class를 선언하는 부분과
 new Test();

 부분으로 자바의 생성자를 호출 함으로서 객체를 생성하는 부분이다.
 내가 왜 이부분을 알아야 한다고 했냐면, 우리가 자바에서 abstract method가 있는 class나 interface의 객체를 생성하면 abstract method를 채워야 한다. 이 말은 선언까지만 하면 추상메소드를 채울 필요가 없다는 사실이다. 참고로 자바에서는 선언만해도 그 class 내부에있는 메소드를 사용이 가능하다. 물론 선언만 한 class 내부에 있는 메소드를 사용하면 NullPointerException이 발생하지만 일단 컴파일러 검사에서는 문제가 없다. 
Ramda
 자바에서는 이를 지원하기 위해 자바 8부터 람다식이라는 것을 지원하는데, 위 java에서 사용한 예제를 람다식으로 변경을 해보겠다.
@FunctionalInterface
public interface CallBackEvent {
    public void callBackEvent(Object obj); 
}

그전과 같이 interface를 만들어주고 @FunctionalInterface어노미테이션을 넣어줌으로서 현재 interface에 람다식으로 사용할 메소드를 하나로 고정한다.
public class MainThread {
    public static void main(String[] args) {
        String name="seung mun";
        Test test=new Test();

        test.testMethod2((obj)->{
            ((Test)obj).testMethod1();
            System.out.println("who are you");
        });
    }
}

위에처럼 작성을 하면 되며 상당히 줄어든다. 여기에서 더 줄어 들 수 도 있는데, 만약 넘겨줄 메소드의 code의 line이 1줄인경우 다음과 같이 할 수도 있다.
public class MainThread {
    public static void main(String[] args){
        Test test=new Test();
        String name="seung mun";

        test.testMethod2((obj)->System.out.println("who are you"));
    }
}

이처럼 자바에서 람다식을 사용함으로 code의 line을 상당히 줄여 줄수 있다.
필요성
java로 조금이라고 디자인패턴을 이용하여 프로그래밍을 하면 code의 line이 상당히 길어 지는데, 이런식으로 만들어지는 code의 line이 늘어나면 하나의 class만 보고 이 class가 무슨일을 하는지 한번에 이해가 어려워 진다. 이때 callback을 이용하면, 하나의 class를 보고 이 class의 역활을 이해하는데 좀더 쉬워진다.

NodeJs/2018-04-17_CasperJsManualAndPoint.body:
CasperJS
CasperJS는 헤드리스 브라우저인 PhantomJS를 사용하여 웹크롤링을 하는데 주로 사용되는 NodeJS API이다. 이 CasperJS를 이용하면 웹 로그인을 하고 로그인을 한뒤에 나오는 페이지에 들어간다음 페이지의 html을 긁어올 수도 있고 캡쳐를 찍을 수도 있다. 이러한 다양한 기능을 조합해서 웹페이지에 들어가 반복적인 동작을 자동화 할수 있으니 코딩을 잘한다면 매우 편리한 것이다 .
PhantomJS
CasperJS에 들어가기 전에 PhantomJS는 위에 말했다 싶이 헤드리스 브라우저인데 이 PhantomJS의 원 목적은 개발자가 웹과 관련되있는 것들을 만들었을때 다수의 테스트를 해야하는 경우 그러한 동작을 자동화 시켜주기 위해 만들어 진 것이며, CasperJS는 그러한 PhantomJS를 사용하기 쉽게 만들어 주는 API일 뿐이다.
시작
일단 CasperJS를 시작하기 위해서는 당연하게 NodeJS와 npm이 설치 되있어야 한다.
이 두가지가 설치가 되있으면, npm을 통하여 phnatomJS와 casperJS를 설치를 추가적으로 해주어야 한다. 이때 이 두 모듈은 글로벌로 설치를 해주어야 한다
npm install -g phantomjs
npm install -g casperjs
이처럼 두개의 모듈이 설치가 끝나면 이제 CasperJS를 사용이 가능하다
접속한 사이트를 캡쳐하는 간단한 예제
var casper=require('casper').create();
casper.start();

casper.viewport(1920,1080);

casper.userAgent('Mozilla/5.0 (Windows NT 6.1; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/66.0.3359.181 Safari/537.36');

casper.open('https://sungmun.github.io/TIL/NodeJs/2018-04-17_CasperJsManualAndPointsToNote.html');

casper.then(function(){
    this.capture('git-casperjs.png',{
        top:0,left:0,width:1920,height:1080
    });
});

casper.run();

이와 같이 코드를 작성한뒤 capture.js로 저장을 한뒤에 저장한 폴더에서  cmd창으로 들어가서 casperjs capture.js를 입력하면 위에 있는 url부분에 해당하는 페이지가 git-casperjs.png로 캡처가 되어 있을 것이다.
한줄 한줄 해석을 하면
var casper=require('casper').create();

맨처음 casper모듈을 선언을 해주는 부분으로 이부분에서 다양한 설정을 해줄수 있지만 생략했다.
casper.start();

casper을 선언해 주었으니 지금부터 casper을 통해서 phantomjs브라우저를 실행하겠다는 의미이다.
casper.viewport(1920,1080);
casper.userAgent('Mozilla/5.0 (Windows NT 6.1; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/66.0.3359.181 Safari/537.36');

크롤링을 할경우 헤드리스 브라우져를 사용해야 하는 이유중 하나로 보통의 다른 언어를 이용하여 크롤링을 할경우 서버와 데이터를 주고 받아야 하는 경우 서버에서 데이터를 못받게 됨으로서 크롤링을 당하고 있다ㅏ는 사실을 바로 알 수 있으나, casperjs를 이용할 경우 userAgent나 viewport를 이용하여 서버에서 상시적으로 요구를 할 수 있는 정보를 저장해두고 바로 바로 전달을 해 줄 수 있다. 이때 userAgent는 현재 접속을 하고 있는 컴퓨터의 정보와 브라우저의 정보 등을 담고 있는 부분이고 viewport는 브라우져를 열었을때, 브라우져 창의 크기를 나타내는 부분이다.
casper.open('https://sungmun.github.io/TIL/NodeJs/2018-04-17_CasperJsManualAndPointsToNote.html');

기본적인 설정이 끝났으니 casperjs를 통해 현재 페이지에 접속을 하는 부분이다. 만약, 다른 페이지를 열어보고 싶으면 url부분만 바꾸면 된다.
casper.then(function(){
    동작...
});

페이지를 열었으니 할 동작을 정해주는 부분으로 Nodejs와 달리 비동기로 이루어 진다는 점이 특이하며, 전의 동작이 이루어 져야 이동작이 이루어 진다. 함수는 심플하게 casper.then(callback);으로 아루어 져있다
casper.capture('git-casperjs.png',{
    top:0,left:0,width:1920,height:1080
});

캡쳐를 하는 동작으로 then으로 전달되는 콜백함수 내부에 위치해있다. 함수는 casper.capture(캡처할 파일의 주소문자열, 캡처할 부위를 지정한 배열);으로 이루어 져있다.
주의할 점
CasperJS는 npm에서 다운을 받을 수는 있지만 node에서 실행이 되지 않는다 위에서 실행예제를 보았다 시피 casperjs를 통해서 실행이 된다. 문제는 이런식으로 실행이 되는 방식이다 보니 npm에서 다운을 받을 수 있는 다양한 모듈을 사용한다는 것을 포기하는게 쉽다. 물론 node에서 기본적으로 지원이 되는 모듈은 지원을 해준다.

NodeJs/2018-04-19_ChildProcessManual.htm.body:
ChildProcess란?
childprocess는 node에서 child_process모듈을 이용하여 현재 쉘이 아닌 다른 쉘을 이용하는 방법으로 node의 특징인 싱글스레드의 성능문제의 해결 방법중 하나이다. node에서 child_process를 호출하고 실행을 할때 child_process를 호출하고 실행하는 프로세스를 부모 프로세스라고 하고 실행되는 프로세스를 자식 프로새스라고 한다.
spawn 기초 예제
var child=require('child_process');
var spawn=child.spawn('ls',['-al','~/']);

간단한 예제로 spawn방식을 이용하여 ls -al ~/을 실행하는 프로세스를 만들어 보았다 물론 이렇게만 하면 아무것도 나오지 않는다. 여기에 자식프로세스에서 보내는 데이터를 받아주는 부분을 정해줘야 결과값이 나온다
spawn.stderr.on('data', function(data){
    console.log('stderr: '+data.toString())
});

spawn.stdout.on('data', function(data){
    console.log('stdout: '+data.toString());
});

spawn.on('exit',function(code,signal){
   console.log('exit: ');
});

이는 자식프로세스에서 오는 데이터를 받는 방법 3가지로, 위에서 부터 애러메세지, 메세지, 종료메세지에 해당한다. 이처럼 spawn방식은 자식 프로세스와 지속적인 데이터를 스트리밍하기에 적합한 방식이다.
exec 기초예제
var child=require('child_process');
var exe=child.exec('ls -al ~/', (error, stdout, stderr) => {
  if (error) {
    console.error(`exec error: ${error}`);
    return;
  }
  console.log(`stdout: ${stdout}`);
  console.log(`stderr: ${stderr}`);
});

exec방식은 자식 프로세스와 주고 받을 데이터가 별로 없을 때 사용되며, 간단한 결과물들을 받을 때 사용된다.
frok 기초예제
var child = require('child_process');
var fork = child.fork('./worker');
child.on('message', function(m) {
  console.log('received: ' + m);
});

child.send('Please up-case this string');

worker.js
process.on('message', function(m) {
  m = m.toUpperCase();

  process.send(m.toUpperCase(m));
});

위 예제는 스택오버플로워에서 퍼온 것이다.
일단 다른 방식들과는 큰 차이점이 있는데 그것은 바로 데이터를 주고 받는 다는 것이다. 다른 방식들은 데이터를 받기만 했지만 fork 방식은 데이터를 주고 받는다. 하나 하나 코드를 설명 하자면, 일단 부모 프로세스 2번째 줄을 통해 node worker.js를 실행하고 부모프로세스에서 자식 프로세스에서 데이터가 오면 어떠한 동작을 할것인지 child.on('message',function())을 통해 정해준다 그다음 자식 프로세스에서 Please up-case this string라는 문자열을 전해준다. 그럼 worker.js에서는 일단 데이터가 오면 무었을 할것인지 정해주는데 그부분이 바로 process.on('message', function(m))부분이다. 여기에서 function부분을 보면 m = m.toUpperCase();부분이 있는데 이부분은 영어를 모두 대문자로 변환해주는 함수이고 process.send(m.toUpperCase(m));부분은 대문자가 된 문자를 부모 프로세스에게 전해준다는 의미이다. 문자를 받은 부모 프로세스는 이제 아까 자식프로세스가 데이터가 오면 어떤식으로 할것인지 정해놓은 대로 동작으로 한다.
단점
일단 기본적으로 childprocess는 node의 한계이자 특징인 싱글스레드를 극복하는 방법으로 유용한 방법이다. 그러나 이 방식은 멀티프로세스의 단점인 메모리 관리에 취약한 측면이 있으며, 서버 동작시에 죽지 않는 프로세스가 생기면 서버가 죽어 버릴수도 있다는 점이 있어 조심히 사용을 해야된다.

NodeJs/Express/Sequelize_Library_Directi.body:
Sequelize 사용법 3
Sequelize의 CRUD(Create Read Update Delete)기능에 대하여 시작을 해보자.
일단 Sequelize를 사용을 하기 위해서는 sequelize-cli를 이용하여 만든 models 부분의 index.js파일을 호출을 하여주어야한다.
import Model from "/models";

위와 같이 호출을 하고나면 Model.User이 처럼 모델들을 호출하여 사용이 가능해진다.
Find
우선은 CRUD에서 가장 간단한 Read에 해당하는 부분을 소개 하겠다.
Model.User.findOne({
  where: {
    id: 1
  }
});

위와 같이 사용을 하면 User테이블에 id값이 1인 값을 찾아서 프로미스의 형태로 id값이 1인 모델을 반환해준다.
Sequelize 는 기본적으로 Promise형태의 비동기 ORM으로 사용을 위해서는 Promise Chain으로 사용을 하던가, async/await를 사용을 하여야 한다.
프로미스 형태를 벗겨내도 모델 형태의 객체로 전달을 해줘서 바로 전달하기에 무리가 있는데, 그럴때,
Model.get({ plain: true });

를 사용하면 전달하기 좋게 깔끔한 데이터 형이 나온다. 물론, 모델형태의 장점은 데이터를 추가적으로 가공을 해야하는 경우 바로 가공이 가능해 상당히 편하다는 장점이 있다.
예를 들어 저번편에 해놓은 관계설정을 이용하여 Join을 하는 방법은 2개정도가 있는데, 첫번째는
Model.회사.findOne({
  include: {
    model: 직원
  },
  where: {
    id: 1
  }
});

위와 같은 방식과
const 남의회사 = await Model.회사.findOne({
  where: {
    id: 1
  }
});
const 남의회사사원 = 남의회사.get사원();

이렇게 보는 방식이 있는데, 전자의 방식의 장점은 비교적으로 Document나 다른곳에 자세히 나와있는 방식이라는 장점이 있으나, 관계가 깊어지면 상당히 복잡해진다는 단점이 있다. 그에 비해 아래의 방식은 상당히 깔끔한 상태를 관계가 깊어져도 유지가 가능하다는 장점이 있으나, Promise Chain을 이용시 위의 방식보다 더 복잡해지는 점과, 문서가 좀 부실하다는 단점이 있다.
이외에도 아래의 방식(시멘틱테그)은 여러가지의 형태를 띄우고 있는데 기본적으로 get,set,add 등이 있으며, 사용의 방식은 연관관계설정을 해놓은 필드의 명을 뒤에 붙이는 형식으로 사용이 가능하다.
Create
Create는 추가적으로 설명할부분이 적은 관계로 간단히 사용법만 적겠다
Model.회사.create({ 회사정보 });

Update
const 남의회사=await Model.회사.build({회사정보}).reload()
...변경...
남의회사.save()

OR
Model.회사.update({
    ...변경할데이터...
})

NodeJs/Express/sequelize-typescript_Libr.body:
Sequelzie-TypeScript 2
sequelize-typescript의 연관관계 맵피에 대하여 설명을 하려고 한다.
우선 sequelize 에서는 연관관계 맵핑을 함수를 이용하여 하였으나, sequelize-typescript에서는 typescript에 있는 어노테이션을 이용하여 연관관계를 맵핑해준다.
기존의 관계에서는 외래키를 어느곳에 위치할것인가에 두고 관계의 명칭이 나뉘었는데, sequelize-typescript는 외래키를 어디에 둘 것 아예 필드값을 만들어버리기때문에 실질적으로 사용되는 명칭이 좀 줄었다. (물론 기존의 명칭을 사용을 할 수는 있는것으로 보이기는 한다.)
@BelongsTo()
@Table
class 톡 extends Model {
  @BelongsTo(() => 카카오톡방)
  카카오톡방: 카카오톡방;
}

여기에서 톡은 카카오톡에서 메세지 하나를뜻하는데, 이경우 톡은 하나의 카카오 톡 방을 가지기 때문에 1:1관계를 뜻하는 BelongsTo연관관계를 사용하였다.
@BelongsToMany
@Table
class 유저 extends Model {
  @BelongsToMany(() => 유저, () => 친구, "userId", "friendId")
  friendList!: User[] | [];
}
@Table
class 친구 extends Model {
  @ForeignKey(() => 유저)
  userId!: number;

  @ForeignKey(() => 유저)
  friendId!: number;
}

위와 같이 N:M관계는 관계를 저장을 해 줄 테이블이 필요하고, 관계를 저장해줄 테이블에 외래키를 이용하여, 값을 저장해줄수 있도록 한다. 그리고 BelongsToMany의 인자값중 첫번째 값은, 현재 테이블과 관계를 맺을 테이블값, 두번째 값은 관계를 저장해줄 테이블값, 세번째값은 관계를 저장해줄 테이블에 현재테이블의 값을 저장할 필드명, 네번째 값은 관계를 저장해줄 태이블에 관계를 맺을 테이블의 값을 저장해줄 필드명이다. 좀 복잡한것같지만 한번 공부해놓으면 그뒤에도 ORM을 사용시 쉽게 이해가 가능하다.
@HasMany
@Table
class 카카오톡방 extends Model {
  @HasMany(() => 톡)
  톡: 톡[];
}

이제 마지막인 1:N관계인데, 카카오톡 방은 다수의 톡을 알고 있어야하므로 1:N관계가 된다. 이때 톡테이블에는 카카오톡방의 외래키가 생성이 되어 있어야한다.
이후의 부분은 컬럼의 상세설정이나 hook을 설정하는 부분인데 이부분은 나도 공부가 부실하여 document를 보고 추가적으로 공부를 해야할것같다. 그외에는 sequezlie-typescript를 직접쓴는 부분은 차후에 포스팅을 할 예정이다.

JavaScript/2018-04-14-JavaScriptGrammar..body:
JavaScript문법
JavaScript이하 js의 간단한 문법에 대하여 기록할 것이다.
변수 선언
js는 변수를 선언할때 다른 언어와는 다르게 변수의 형을 지정해주지 않으며, 간단하게 
'var 변수명' 과 같이 선언을 해준다. 이때 변수에 들어갈 수 있는 값으로는 정수, 실수, true, false, 문자열, 함수 등이 들어간다.
이때 문자열은 
 var str='문자열'

 과 같이 '(작은 따음표)로 묶어 주던가 
 var str="문자열"

 과 같이 "(큰 따음표)로 묶어주면 문자열로 인식을 한다.
제어문
js에서 제어문은 C에서 사용되는 제어문을 대부분 사용을 한다. 추가가 되는 부분은 for문의 새로운 특성부분정도만 알면 된다.
for(var i in array){
    console.log(i);
}

위 와 같이 for문을 사용하는 경우, array에 있는 값이 앞에 서부터 차례대로 i에 들어가서 실행이 된다.
함수
js에서의 가장 큰 특징중 하나가 함수이다. 일단 기본적인 사용법은 
var fun=function(params) {
    ....
}

과 같이 함수를 정해주고 그 함수를 변수에 저장을 하여 사용하는 방법과, 
function fun(params) {
    ....
}

C와 같이 함수명을 정해주고 그 함수 명을 호출하는 사용하는 방법이 있다.
이때 params를 넘겨 줄수 있는데 넘겨주는 값은 함수가 될수 도 있어서 넘겨주는 값이 함수일경우 이 값을 콜백함수라고 한다
function fun(params) {
    ....
    params();
}

fun(function(){
    console.log('callBackFunction');
});

위와 같이 사용이 가능하며, 위와 같이 사용을 할경우, fun함수를 실행후 'callBackFunction'문자열을 console창에 출력을 해주며 끝이 날것이다.

