Func fun=(x,y)=>x+y;

Func는 람다식을 좀더 편하게 사용하기 위한 식으로 Func라는 식에서 마지막 int는 반환형이고 그외의 모든 int는 인자값의 형태를 뜻한다.
Action 델리게이트
